LOFEAR đến từ vùng đất được xem là nơi sinh ra hay trở về của rất nhiều nghệ sĩ trẻ, thành phố Đà Lạt. Anh bắt đầu hành trình âm nhạc của mình từ những năm 2014. Âm nhạc của LOFEAR như một bức tranh với màu sắc nổi bật, tương phản rõ nét với nguồn nguyên liệu là cảm xúc đa dạng, hồn nhiên. Từ giữa 2016, tham gia vào Jaunty Maniacs  với vai trò là creator và Producer, anh phát hành tác phẩm đầu tiên được kết hợp cùng DBaola - Bloody Loli tại Diversity Record, đây cũng cột mốc khởi đầu sự nghiệp của anh với vai trò DJ/Producer khi anh liên tiếp xuất hiện tại những events, festival uy tín trên khắp cả nước như Diary of Maniacs, Ravolution 2019.

Festival: Vibe Nation, Ravolution Music Festival 2019
Event: D.O.M : Manique, Jaunty Pool, Jaunty Style, 2Drug, Light Up hosted by DJ Hoang Anh...
Venue: F Club HN, The Fog Bar, KOZY Dalat, Young Alley, 2Ez, Bliss Ultra Lounge, DON QUIXOTE DALAT

